import './App.css';
import Main from './book'
import Login from './login'
import { BrowserRouter as Router } from "react-router-dom";
import ReactDOM from "react-dom";
import { Link, Route, Switch } from "react-router-dom";


function App() {
  return (
    <Router>
    <div className="App">
      <Login/>
      <switch>
        <Route path="/search">
          <Main/>
        </Route>
      </switch>
    </div>
    </Router>
  )}

export default App ;
